import { useEffect } from 'react'

const Countries = ({ countrySearched, countries, setCountries, countriesNames }) => {

  useEffect(
    countriesNames.filter(countryNames => {
      return countryNames.filter(countryName => {
        return countryName.includes(countrySearched)
      })
    }), [])
  
  
  return (
    <ul>
      {countries.map(country => <li key={country[0]}>{country[0]}</li>)}
    </ul>
  )
}


export default Countries
